import { v4 as uuidv4 } from "uuid";
import style from "./CalendarCell.module.css";

function CalendarCell(props) {
  let classNameContainer = props.classNegative
    ? style.negative
    : props.todayIndex
    ? style.current
    : "";

  return (
    <div
      onClick={props.onClick}
      className={classNameContainer}
      key={uuidv4()}
      data-id={props.key + props.indexID}
    >
      {props.children}
      {props.classNegative || (
        <div className={style["dot__container"]}>
          {props.expenseIndex && (
            <span className={`${style["dot--blue"]} ${style.dot}`}></span>
          )}
          {props.incomeIndex && (
            <span className={`${style["dot--pink"]} ${style.dot}`}></span>
          )}
          {props.bothIndex && (
            <>
              <span className={`${style["dot--blue"]} ${style.dot}`}></span>
              <span className={`${style["dot--pink"]} ${style.dot}`}></span>
            </>
          )}
        </div>
      )}
    </div>
  );
}

export default CalendarCell;
